import React from 'react';
import useInputValue from '../hooks/useInputValue';

const Input = ({type = text}) => {
  const username = useInputValue('')
  return (
    <>
      <input
        type="text"
        name="username"
        {...username}
      />
    </>
  );
};

export default Input;
